import React from 'react'
import { NavLink } from 'react-router-dom'

const Navbar1 = () => {
    return (
        <div>
            <h1>HelloS</h1>
            <NavLink to='./'><p>Home</p></NavLink>
        </div>
    )
}

export default Navbar1
